import React, { useEffect } from 'react'
import { useNavigate } from 'react-router-dom'

function Home(props) {
    const navigate = useNavigate();

    useEffect(() => {
        const token = localStorage.getItem('TOKEN');
        if (!token) {
            navigate('/signin');
        }
    })
    return (
        <div class='navbar navbar-expand-lg bg-body-tertiary fixed container'>
            {/* Application */}
            <div class='d-flex mr-auto'>
                <span>{'df'}</span>
                <button class="btn btn-outline-primary mr-2">LOGOUT</button>
            </div>
        </div>
    )
}

export default Home
